{-# LANGUAGE OverloadedStrings #-}

import Graphics.UI.Threepenny.Core
import qualified Graphics.UI.Threepenny as UI

main :: IO ()
main = startGUI defaultConfig { jsPort = Just 8023 } setup

setup :: Window -> UI ()
setup window = do
    -- Set the window title
    return window # set title "Hello Threepenny-GUI"

    -- Set the background image using a Base64-encoded image (replace this with your Base64 string)
    getBody window # set UI.style [("background-image", "url('data:image/jpeg;base64,')"),
                                  ("background-size", "cover"),
                                  ("height", "100vh")]

    -- Create a button and output
    button <- UI.button # set UI.text "Click me!"
    output <- UI.div # set UI.text "Hello, World!"
    
    -- Add elements to the window
    getBody window #+ [column [element button, element output]]

    -- Set the button click action
    on UI.click button $ \_ -> do
        element output # set UI.text "Button Clicked!"
    
    return ()  -- Ensures the 'do' block ends with a valid expression
